import React, { useState, useEffect } from 'react';
import { Card, Form, Select, Radio, Space, InputNumber, Typography } from 'antd';
import type { RadioChangeEvent } from 'antd';
import './Calculator.css';

const { Option } = Select;
const { Title, Text } = Typography;

interface PriceData {
  basePrice: number;
  addressPrices: {
    virtual: number;
    physical: number;
  };
  boiPrice: number;
  sealPrice: number;
  stateTaxes: Record<string, number>;
}

const Calculator = () => {
  const [form] = Form.useForm();
  const [totalPrice, setTotalPrice] = useState(0);

  // 模拟价格数据
  const priceData: PriceData = {
    basePrice: 299,
    addressPrices: {
      virtual: 99,
      physical: 199,
    },
    boiPrice: 99,
    sealPrice: 49,
    stateTaxes: {
      'Delaware': 90,
      'Wyoming': 50,
      'Nevada': 75,
      'Florida': 125,
      'California': 800,
      'New York': 200,
    }
  };

  const calculatePrice = () => {
    const values = form.getFieldsValue();
    const state = values.state || 'Delaware';
    const addressType = values.addressType || 'virtual';
    const needBoi = values.needBoi || false;
    const needSeal = values.needSeal || false;
    
    let price = priceData.basePrice;
    price += priceData.stateTaxes[state] || 0;
    price += priceData.addressPrices[addressType];
    
    if (needBoi) {
      price += priceData.boiPrice;
    }
    
    if (needSeal) {
      price += priceData.sealPrice;
    }
    
    setTotalPrice(price);
  };

  useEffect(() => {
    calculatePrice();
  }, []);

  return (
    <Card className="calculator-card">
      <div className="calculator-container">
        <div className="calculator-form">
          <Title level={4}>公司注册费用计算器</Title>
          <Form
            form={form}
            layout="vertical"
            initialValues={{
              state: 'Delaware',
              addressType: 'virtual',
              needBoi: false,
              needSeal: false,
            }}
            onValuesChange={calculatePrice}
          >
            <Form.Item name="state" label="注册州">
              <Select placeholder="选择注册州">
                <Option value="Delaware">特拉华州 (Delaware)</Option>
                <Option value="Wyoming">怀俄明州 (Wyoming)</Option>
                <Option value="Nevada">内华达州 (Nevada)</Option>
                <Option value="Florida">佛罗里达州 (Florida)</Option>
                <Option value="California">加利福尼亚州 (California)</Option>
                <Option value="New York">纽约州 (New York)</Option>
              </Select>
            </Form.Item>
            <Form.Item name="addressType" label="地址类型">
              <Radio.Group>
                <Radio value="virtual">虚拟地址</Radio>
                <Radio value="physical">实体地址</Radio>
              </Radio.Group>
            </Form.Item>
            <Space>
              <Form.Item name="needBoi" valuePropName="checked" label="需要BOI申报">
                <Radio.Group
                  options={[
                    { label: '是', value: true },
                    { label: '否', value: false },
                  ]}
                  optionType="button"
                />
              </Form.Item>
              <Form.Item name="needSeal" valuePropName="checked" label="需要纸质印章">
                <Radio.Group
                  options={[
                    { label: '是', value: true },
                    { label: '否', value: false },
                  ]}
                  optionType="button"
                />
              </Form.Item>
            </Space>
          </Form>
        </div>
        <div className="calculator-result">
          <Card className="price-card">
            <Title level={4}>费用总计</Title>
            <div className="price-amount">
              <span className="currency">$</span>
              <span className="amount">{totalPrice}</span>
            </div>
            <Text type="secondary">包含全套公司注册服务</Text>
          </Card>
        </div>
      </div>
    </Card>
  );
};

export default Calculator;
